import React from "react";
import "./ProductDetailUnderSlider.scss";
function ProductDetailUnderSlider() {
  return (
    <div className="product-detail-under-slider">
      <img
        src="https://s3-alpha-sig.figma.com/img/5c52/c549/c02d7ae2bd5176559d307263d3ae455c?Expires=1602460800&Signature=Oj2hL8TURQs8MZJvELpcUSKfaUcLOQ3jlgkMMAx9pUPT61DLiIyEX4ocivYwumqWVGup9XckV2SUrnn78oq3ZocWpgPFYQ3GlvvXnMnCgyh2DcvSqYfNQemzQwbd7pavamJc5PzqtbwtVnrfUqi88tbnrCfRaNSpRpc2qXNPa9qziEOo5yRoyec9STMrzUQ9c6BgwWO8ChBIQL8iRvvgtModiAm6zcbXO5zw2jFK8kfv1XFLcscF4BxN~FCjtA4ngYNUg4KCqtuCc8ilgkXVZGcjOgKvjriSCJDhkuaEMIhvbp7-7B8476WufZ7HQYMuUsoT7q0RtHig-6feR2bdzw__&Key-Pair-Id=APKAINTVSUGEWH5XD5UA"
        alt="clock wefwee"
      />

      <div>
        <h3>
          Buy the Samsung Gear S4 Smartwatch at a 20% discount, which caused the
          hottest noise of the day.
        </h3>

        <button className="text-uppercase">buy now</button>
      </div>
    </div>
  );
}

export default ProductDetailUnderSlider;
